import "./Button.css";

const Button = () => {
  const isAdmin = true;

  if (isAdmin) {
    return (
      <div>
        <span>Admin</span>
        <button className="bordered-button">Click me!</button>
      </div>
    );
  }
  return (
    <div>
      <span>User</span>
      <button className="bordered-button">Click me!</button>
    </div>
  );
};

export default Button;
